import './style.css';
import { ReactComponent as  SearchIcon} from './assets/ic-close-input.svg';
import { ReactComponent as CloseIcon} from './assets/ic-search.svg';

export function Search({onSubmit,handleInputChange}) {
  return (
    <form className='search' onSubmit={onSubmit} >
      <input type="text" className="search__input" onChange={(e) => {handleInputChange(e.target.value)}} placeholder='Поиск'/>
      <button className="search__btn">
        <SearchIcon/>
        <CloseIcon/>
      </button>
    </form>
  );
  }
